import React, { Component } from 'react';
import './../Css/Footer.css'

class FooterSect extends Component {
    render() {
      return (
          <section className="red">
              <MoreSect />
              <Footer />
          </section>
      )
    }
  }


class Footer extends Component {
    render() {
      return (
        <footer>
            <div>footer contents</div>
            <div>footer contents</div>
        </footer>
      )
    }
  }

class MoreSect extends Component {
    render() {
        return (
            <div className="cf">
                <article className="newsImg flt_left">news1</article>
                <article className="newsImg flt_left">news2</article>
                <article className="newsImg flt_left">news3</article>
                <article className="newsImg flt_left">news4</article>
            </div>
        )
    }
}

export default FooterSect;
